export const types = [
  {
    normal: { color: "#212121;", bgColor: "#A4ACAF;" },
    psychic: { color: "#FFFFFF;", bgColor: "#F366B9;" },
    dark: { color: "#FFFFFF;", bgColor: "#707070;" },
    poison: { color: "#F0E3F3;", bgColor: "#B97FC9;" },
    flying: { color: "#4F4E4E;", bgColor: "#BDB9B8;" },
    rock: { color: "#FAF9F3;", bgColor: "#A38C21;" },
    fighting: { color: "#FFFFFF", bgColor: "#D56723" },
  },
];

export const sliderData = {
  cosmog: {
    number: "#789",
    name: "Cosmog",
    kanji: "コスモッグ",
    types: ["psychic"],
    img: { cosmogImg },
    bgColor: "#EEEC7F",
  },
  corsola: {
    number: "#864",
    name: "Corsola",
    kanji: "サニーゴ",
    types: ["dark"],
    img: { corsolaImg },
    bgColor: "#8F8F90",
  },
  bewear: {
    number: "#760",
    name: "Bewear",
    kanji: "キテルグマ",
    types: ["normal", "fighting"],
    img: { bewearImg },
    bgColor: "#EDA5B3",
  },
};
